import LogicManager from "../businesslogic/LogicManager";
import Alert from '@mui/material/Alert';


const Error = () => {
    const message = LogicManager.getInstance().getExceptionManager().getMessageList();

    message.map(item => <Alert icon={<CheckIcon fontSize="inherit" />} severity="success">
        {item}
    </Alert>)

    return (<div className="error-container">
        {message}
    </div>)
}

export default Error;
